// ==UserScript==
// @name        DeviantArt Icon Change
// @namespace   sollace
// @icon        https://raw.githubusercontent.com/Sollace/UserScripts/master/DA++/logo.png
// @include     http://*.deviantart.*
// @include     https://*.deviantart.*
// @include     http://sta.sh*
// @include     https://sta.sh*
// @version     1.3.2
// @grant       none
// @run-at      document-start
// ==/UserScript==

var FAVICON = 'data:image/x-icon;base64,';
var LOGO = 'http://fc00.deviantart.net/fs70/i/2014/341/8/e/da_logo_concept_by_comeha-d893jng.png';
var HOLS = 'data:image/png;base64,';
var done = false;

document.onmousemove = document.onready = function() {
  changeLogo(LOGO, FAVICON, HOLS);
}
document.onmousemove();

function changeLogo(url, icon, holi) {
  if (typeof $ === 'undefined') {
    var head = document.head;
    if (typeof document.head === 'undefined') {
      var svg = document.getElementsByTagName('svg');
      if (svg != null && svg.length) {
        head = document.getElementsByTagName('svg')[0];
      }
    }
    if (head.innerHTML.indexOf('shortcut icon') == -1) {
      head.innerHTML = '<link xmlns="http://www.w3.org/1999/xhtml" rel="shortcut icon" href="' + icon + '" />' + head.innerHTML;
    }
  } else {
    $('head link[rel="shortcut icon"]').remove();
    $('head').first().append('<link rel="shortcut icon" href="' + icon + '" />');
    $('#deviantart-logo .mark').html('<img style="margin-left:-10px" height="30px" src="' + url + '" />');
    $('img[data-embed-id="619"], [collect_rid="emote:619"] img').attr({
      'src': url,
      'width': '19px',
      'height': '12px'
    }).css({
      'width': '19px',
      'height': '12px'
    });

    var css = '\
\
@font-face{\
	font-family:"usersymbol-icons-old";\
	src:url("//st.deviantart.net/misc/symbols/deviantart-symbols2.eot");\
	src:url("//st.deviantart.net/misc/symbols/deviantart-symbols2_iefix.eot") format("embedded-opentype"),url("//st.deviantart.net/misc/symbols/deviantart-symbols2.woff") format("woff"),url("//st.deviantart.net/misc/symbols/deviantart-symbols2.ttf") format("truetype"),url("//st.deviantart.net/misc/symbols/deviantart-symbols2.svg#deviantart-symbols-icons") format("svg");\
	font-weight:normal;\
	font-style:normal;\
	font-variant:normal}\
span.user-symbol.admin {\
  font-family: usersymbol-icons-old !important;}\
\
.dev-page-view .dev-right-bar-title.more-from-da-title {\
background: url(' + url + ') no-repeat 0px 5px/25px auto !important;}';

    if (!done) {
      done = true;
      if (el('#iconStyle').length == 0) {
        style(css).setAttribute('id', 'iconStyle');
      } else {
        el('#iconStyle').innerHTML = css;
      }
    }

    if ($('#holiday_logo_a').length) {
      $('#holiday_logo_a img').attr('src', holi);
    }
  }
}
  
function el(select) {
  if (document['querySelectorAll']) {
    return document.querySelectorAll(select);
  }
  if (select.indexOf('#') == 0) {
    return [document.getElementById(select.replace('#', ''))];
  } else if (select.indexOf('.') == 0) {
    return document.getElementsByClassName(select.replace('.',''));
  }
  return document.getElementsByTagName(select);
}

function style(css) {
  var tag = document.createElement('STYLE');
  tag.type = 'text/css';
  tag.innerHTML = css;
  document.head.appendChild(tag);
  return tag;
}